import React, { Component } from 'react';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
 



import Rider from "./Rider";
import RiderList from "./riderlist";
class App extends Component {
  render() {
    return (      
       <BrowserRouter>
        <div>
           <Switch>                                     
            <Route path="/rider">
             <Rider />
            </Route>
            <Route path="/riderList">
             <RiderList />
             </Route>
           </Switch>
        </div> 
      </BrowserRouter>
    );
  }
}
 
export default App;
